ミリオントイレカラー 5球200g<br>男子用トイレ専用の芳香ボールです。使い方は小便器の中に入れておくだけと簡単。さらに本品はパラジクロルベンゼン製剤に清浄剤を配剤することにより、清潔な香りを残すだけでなく、汚れを落とす効果もプラスした清浄防臭剤です。男子用トイレの特有の臭いを効果的に防ぎます。 消臭剤全部とは消臭剤は、お部屋やトイレ、車の中など、あらゆる空間の嫌なニオイを消す商品です。屋外用、業務用の消臭剤から、赤ちゃんがいても使える自然派の消臭剤まで豊富なラインナップ。消臭スプレー、消臭シール・消臭ボトル等、用途に合った消臭剤をお選び下さい。 <br>販売_製造元： 桂屋ファイングッズ<br>ブランド：<br>JAN：4901425129207<br>cs：60<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
