トイレ用洗剤／トイレ用洗剤<br>「サッとひと拭き」するだけで、気軽にイヤなニオイが抑えられる。<br>トイレットペーパーがボロボロにならないので、気軽に「サッとひと拭き」ができるトイレのふき取りクリーナー。●「抗菌成分」配合で、ニオイ菌まで抑える。●トイレットペーパーの崩れを防ぐ「ボロボロ防止成分」を配合。●洗浄・除菌成分が、飛び散った尿汚れやバイ菌まで、すっきり落とす。●棚にしまわずに出しておけるコンパクトでキュートなデザイン。●スッキリ爽やかなクリアミントの香り。<br><br>商品名：ライオン ＊ルックまめピカトイレクリーナ抗菌プラス２１０ＭＬ ＜2013年秋の新製品＞  ※ 9月20日 より順次出荷予定<br>ルックまめピカ抗菌プラストイレのふき取り２１０ｍｌ<br>ブランド：ルツク<br><br>「サッとひと拭き」するだけで、気軽にイヤなニオイが抑えられる。<br><br> JAN：4903301194194<br>販売元：　ライオン<br><br>CS：18<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
